import React, { useState } from "react";

function DropdownItem(props) {
  const [open, setOpen] = useState(false);
  return (
    <li className="nav-item">
      <a onClick={() => setOpen(!open)}>{props.icon}</a>
      <span>{props.name}</span>
      {open && props.children}
    </li>
  );
}

export default DropdownItem;
